window.bookSummaryJSON = "<p>Tanner is a country boy who is pressed into the army due to the upcoming battle with the powerful kingdom of Tavor. During his training, Tanner insults a powerful magic user and is scheduled to die in a duel with said mage as a result. It was during this battle that Tanner discovered a power not seen before - the ability to dispel magic. Tanner quickly gains the attention of the king, who wants to use Tanner as a guard to protect his daughter and as an assassin to fight against the mages of Tavor.</p>"; 
